import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FabricJSCanvas, useFabricJSEditor } from './fabricCanvas';

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [uploadedImgURL, setUploadedImgURL] = useState(null);
  const [focalPoints, setFocalPoints] = useState([]);
  const [videoURL, setVideoURL] = useState(null);

  const { editor, onReady } = useFabricJSEditor();

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setSelectedFile(file);
      const reader = new FileReader();
      reader.onload = (evt) => setUploadedImgURL(evt.target.result);
      reader.readAsDataURL(file);
    }
  };

  useEffect(() => {
    if (editor && uploadedImgURL) {
      editor.canvas.clear();
      window.fabric.Image.fromURL(uploadedImgURL, (img) => {
        editor.canvas.setWidth(img.width);
        editor.canvas.setHeight(img.height);
        editor.canvas.add(img);
        editor.canvas.renderAll();
      });
    }
  }, [editor, uploadedImgURL]);

  useEffect(() => {
    if (!editor) return;
    const canvas = editor.canvas;

    const handleClick = (opt) => {
      if (!canvas.backgroundImage) return;
      if (focalPoints.length >= 3) return; // only allow 3

      const pointer = canvas.getPointer(opt.e);
      setFocalPoints((prev) => [...prev, { x: pointer.x, y: pointer.y }]);
    };

    canvas.on('mouse:down', handleClick);
    return () => {
      canvas.off('mouse:down', handleClick);
    };
  }, [editor, focalPoints]);

  const handleResetFocalPoints = () => {
    setFocalPoints([]);
  };

  const handleProcessImage = async () => {
    if (!selectedFile) {
      alert('Please upload a 6024x4024 image.');
      return;
    }
    if (focalPoints.length < 3) {
      alert('Please click exactly 3 focal points on the image.');
      return;
    }

    try {
      const formData = new FormData();
      formData.append('image', selectedFile);
      formData.append('focalPoints', JSON.stringify(focalPoints));

      const response = await axios.post('http://127.0.0.1:5000/api/process_image', formData, {
        responseType: 'blob' // important to handle binary file (MP4)
      });

      // Create a local URL to the video blob
      const videoBlob = new Blob([response.data], { type: 'video/mp4' });
      const videoObjectURL = URL.createObjectURL(videoBlob);
      setVideoURL(videoObjectURL);

    } catch (error) {
      console.error(error);
      alert('Error processing image: ' + error?.response?.data?.error || 'Unknown error');
    }
  };

  return (
    <div style={{ margin: 20 }}>
      <h1>6024x4024 Image â†’ 3-Section Video Demo</h1>
      <input type="file" accept="image/*" onChange={handleFileChange} />

      <div style={{ marginTop: 10 }}>
        <button onClick={handleResetFocalPoints}>Reset Focal Points</button>
        <button onClick={handleProcessImage}>Process Image</button>
      </div>

      <p>Focal Points: {JSON.stringify(focalPoints)}</p>

      <div style={{ marginTop: 20, border: '1px solid #ccc', display: 'inline-block' }}>
        <FabricJSCanvas onReady={onReady} />
      </div>

      {videoURL && (
        <div style={{ marginTop: 20 }}>
          <h2>Resulting Video (MP4):</h2>
          <video
            src={videoURL}
            controls
            autoPlay
            style={{ width: 600, backgroundColor: '#000' }}
          />
          <p>
            <a href={videoURL} download="output.mp4">Download MP4</a>
          </p>
        </div>
      )}
    </div>
  );
}

export default App;
